import React from 'react';
import TextChat from './icons/TextChat';
import Blur from './icons/Blur';
import CameraButton from './icons/CameraButton';
import MicButton from './icons/MicButton';
import LogoutButton from './icons/LogoutButton';
import AddOthers from './icons/AddOthers';
import ScreenShare from './icons/ScreenShare';

const RoomHeader = (props) => {

  return (
    <div id="toolbar">

      {/* Camera button */}
      <CameraButton room={props.room} />

      {/* microphone button */}
      <MicButton room={props.room} />

      {/* Add others button */}
      <AddOthers roomName={props.roomName} />

      {/* End call button */}
      <LogoutButton handleLogout={props.handleLogout} />

      {/* Screen Sharing button */}
      <ScreenShare room={props.room} />

      {/* Text chat button*/}
      <TextChat room={props} />

      {/* Blur Background  button*/}
      <Blur participant={props.room.localParticipant} />

    </div>
  );
}
export default RoomHeader;
